column8:
多忙な起業家やクリエイター向けにつくられたバックパックです。<br>
デザインはゆったりとしたスペースと快適さを保ちながら、<br>
ラップトップやオフィスの必需品を素早く取り出すことができる機能性を持っています。<br><br>
Lサイズは15～17インチまでのノートパソコンが収納できるポケット付き。<br>
大容量で無駄のない収納スペースを持つリュックサック。<br>
<br>
■サイズ：Lサイズ<br>
横：約32cm×高さ：約52cm×マチ23.5cm <br>
ラップトップ収納部<br>
Height: 34 cm<br>
Width: 29 cm<br>
Depth: 4 cm<br><br>
■素材 <br>
ECO YARN<br>
<br>
■実際の色とモニター画面では、見た目の色に多少違いがあります。<br>
商品についてご不明な点がございましたらお気軽にお問合せくださいませ。

