メーカー希望小売価格はメーカー商品タグに基づいて掲載しています<br><br>

anello人気No.1口金リュックのコットンキャンバスバージョンです。デニムとキャンバス配色の2展開。<br>
<br>
開口部のファスナーを開けると、がばっ！と開く人気の口金入りリュック。カジュアルで爽やかな印象の薄手のコットンキャンバスを使用しており、オフホワイトのステッチがさりげなく効いています。<br>
<br>
軽量なのにA4サイズ収納可能で大容量！背負ったままでも片手で出し入れできる背面直結ファスナー＆500mlペットボトルが入るサイドポケットが付いて、機能的。<br>
<br>
素材：綿<br>
重さ：約550g<br>
開口部メイン：ファスナー<br>
<br>
サイズ：27cm×40cm×17cm <br>
<br>
※サイズ目安：A4サイズ収納可能<br>
持ち手長さ：33cm<br>
ショルダー紐長さ：42～85cm<br>
<br>
【外側ポケット】<br>
オープンポケット×2 ファスナーポケット×1 背面直結ファスナー×1<br>
【内側ポケット】<br>
オープンポケット×2<br>
<br>
性別：ユニセックス<br>
<br>
※生地や個体差でサイズと重さが若干異なる場合ございます。<br>
<br>
※色目に関してはご覧頂いているディスプレイやスマートフォンの画面により、画像と実物の差がある場合がございますが予めご了承ください。<br><style type="text/css">
