SWISSWIN リュック SW9032N<br>
　<br>
・12～15インチPC入れ<br>
・摩擦に強い素材で、耐久性に優れたバックパック。<br>
・撥水加工で大切なアイテムをしっかりガード。<br>
・肩掛け部分には強ストレッチ発泡、メッシュを採用<br>
・旅行、ビジネス、出張、登山、通勤通学、バイクや自転車等に最適です。<br>
デザイン性と機能性、大容量で人気のスイスウィンのリュック<br>
耐久性に優れた防弾チョッキに使用される1680Dballistic nylon(バリスティックナイロン)生地を仕様。<br>
メーカー実験にてナイフで擦ってみても薄く傷がつくだけで使用には問題なし。<br>
磨耗・引き裂き・すり傷に強くなっています。<br>
背中の汗を逃すための3D-AIR FLOWはベンチレーターの役目をする立体構造パーツ。<br>
メガネやサングラスをかけられるベルト付です。<br>
クッション性の高い背面やサイドにボトルホルダーも。<br>
プレゼントにもピッタリです。<br>
<br>
【仕様】<br>
外寸サイズ：約W32.5×H46×D19.5cm<br>
重さ：約800g<br>
容量：約30L<br>
素材：外側：1680Dバリスティックナイロン・ポリエステル<br>
内側：ポリエステル<br>
カラーバリエーション：ブラック<br>
<br>
